import React from 'react';
import './nav.css';

function Nav(props) {
  const linkTitle = props.value;
  const links = linkTitle.map((number) =>
    <li className='nav-link' key={number.id} href={number.add}>
        {number.title}
        {console.log(number.id)}
    </li>
  );

  return (
    <div className="navbar">
        <ul className="nav">
          {links}
        </ul>
      </div>
  );
}

export default Nav;
